import styled from "@emotion/styled";

import { Keyboard } from "./keyboard";

export default function Logout() {
  return (
    <Container>
      {" "}
      <Header>
        <KeyboardSvgBox>
          <Keyboard />
        </KeyboardSvgBox>
        키지엠
      </Header>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  position: relative;
  margin: auto;
  max-width: 380px;
  height: 100%;
`;

const Header = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 15px;
  width: 100%;
  height: 70px;
`;

const KeyboardSvgBox = styled.div`
  width: 40px;
`;
